%spark
import scala.collection.mutable.ListBuffer

def getStructs(): (String => (Boolean, List[String])) = { text =>
	if (null == text) {
		(false, null)
	} else {
		var str = text.trim
		val leng = str.size
		val strUpper = str.toUpperCase.replaceAll(" +", "")
		if (leng <= 4 || strUpper.startsWith("#REDIRECT[[")) {
			(false, null)
		} else {
			val structs = new ListBuffer[String]()
			var count = 0
			var started = false
			var structFrom = 0
			var structTo = leng - 1
			var struct = ""
			var endSign = ""
			var startSign = ""
			var cur = ""
			var index = 0
			while (index < leng -1) {
				cur = str.slice(index, index + 2)
				if (started) {
					if (cur == startSign) {
						count += 1
					}
					if (cur == endSign) {
						count -= 1
					}

					if (count == 0) {
						structTo = index
						struct = str.slice(structFrom, structTo + 2)
						structs.append(struct)
						started = false
					}

					index += 1
				} else {
					if (cur == "{{" || cur == "[[" || cur == "{|" || cur == "<!") {
						started = true
						structFrom = index
						count += 1
						if (cur == "{{") {
							startSign = "{{"
							endSign = "}}"
						} else if (cur == "[[") {
							startSign = "[["
							endSign = "]]"
						} else if (cur == "{|") {
							startSign = "{|"
							endSign = "|}"
						} else {
							startSign = "<!"
							endSign = "->"
						}
					}

					index += 1
				}
			}

			if (started) {
				struct = str.slice(structFrom, leng)
				structs.append(struct)
				(true, structs.toList)
			} else {
				(false, structs.toList)
			}
		}
	}
}

val extStructs = udf(getStructs)

