import scala.collection.mutable.WrappedArray

def metaStruct(): (WrappedArray[String] => List[Int]) = { structs =>
	if (null == structs) {
		null
	} else {
		val total = structs.size
		var curlyCount = 0
		var squareCount = 0
		var tableCount = 0
		var cmtCount = 0

		for (i <- structs) {
			if (i.startsWith("{{")) {
				curlyCount == 1
			} else if (i.startsWith("[[")) {
				squareCount += 1
			} else if (i.startsWith("{|")) {
				tableCount += 1
			} else if (i.startsWith("<!")) {
				cmtCount += 1
			}
		}

		List(total, curlyCount, squareCount, tableCount, cmtCount)
	}
}

