def getSpeStruct(structType: String, structSign: String): (WrappedArray[String] => WrappedArray[String]) = { structs =>
	if (null == structs) {
		null
	} else {
		var cur = ""
		val head = structSign + structType 
		val rst = structs.filter(x => {
			cur = x.trim.toLowerCase.replaceFirst(" +", "")
			cur.startsWith(head)
		})

		if (rst.isEmpty) {
			null
		} else {
			rst
		}
	}
}

